import os
import tensorflow as tf
import numpy as np
import model
from data_filter_all_function import parseLine, createUnitDict
import time
import json

BIN_PATH = "C:\\School Work\\BOSS\\bin"
PARSER_PATH = BIN_PATH + "\\data"
MODELS_PATH = PARSER_PATH + "\\models"

class Network:
    def __init__(self, network_name, network_type, use_gpu=False):
        if not use_gpu:
            config = tf.ConfigProto(
            device_count = {'GPU': 0}
            )
            self.sess = tf.Session(config=config)
        else:
            self.sess = tf.Session()
        tf.keras.backend.set_session(self.sess)

        self.name = network_name + ".h5"
        self.NUM_PROTOSS_UNITS = 69
        self.MAX_NUM_UNITS = 35
        self.feature_shape = (self.MAX_NUM_UNITS * 15) + 12 + self.NUM_PROTOSS_UNITS
        self.policy_shape = self.NUM_PROTOSS_UNITS
        self.value_shape = 1
        self.learning_rate = 1e-4
        self.epochs = 1
        self.verbose = 1
        self.batch_size = 4

        with open("C:\\School Work\\BOSS\\bin\\SC2Data.json") as sc2dataFile:
            sc2data = json.load(sc2dataFile)
            self.mins_per_worker_per_sec = sc2data["MineralsPerWorkerPerFrame"]
            self.gas_per_worker_per_sec = sc2data["GasPerWorkerPerFrame"]

        self.loadNetwork(network_type)
        self.unit_dict = createUnitDict("C:\\School Work\\BOSS\\bin\\data\\ActionData.txt")

    def loadNetwork(self, network_type):      
        if network_type == "policy":
            self.network = model.PolicyNetwork(self.feature_shape, self.policy_shape, self.name, 
                                                self.batch_size, self.learning_rate, MODELS_PATH + "\\" + self.name, False)
        elif network_type == "value":
            self.network = model.IntegralValueNN(self.feature_shape, self.value_shape, self.name, 
                                                self.batch_size, self.learning_rate, MODELS_PATH + "\\" + self.name, False)
        elif network_type == "both":
            self.network = model.PolicyAndValueNetwork(self.feature_shape, self.policy_shape, self.value_shape,
                self.name, self.batch_size, self.learning_rate, MODELS_PATH + "\\" + self.name, False)
        else:
            print("invalid network type")

        self.network.load(MODELS_PATH + "/" + self.name)

    def parseString(self, csv_string, shape):
        split_string = tf.string_split(tf.expand_dims(csv_string, axis=0), ",")
        data = tf.string_to_number(tf.sparse_tensor_to_dense(split_string, default_value=''), tf.float32)
        d = tf.squeeze(data)
        x = d[-(shape+1):]
        return x

    def evaluate(self, x_val, y_pred):
        #nn_input = tf.convert_to_tensor(list(map(lambda x: self.parseString(x), x_val.split("\n"))))
        nn_input = tf.convert_to_tensor(list(map(lambda x: self.parseString(x, self.feature_shape), x_val.split("\n"))))
        actual = tf.convert_to_tensor(list(map(lambda x: self.parseString(x, self.policy_shape), y_pred.split("\n"))))

        # output = self.network.model.predict(nn_input, steps=1)
        output = self.network.model.evaluate(nn_input, actual, steps=1)
        return output

    def predictParsed(self, data):
        nn_input = tf.convert_to_tensor(list(map(lambda x: self.parseString(x, self.feature_shape), data.split("\n"))))
        # output = np.ndarray.tolist(np.squeeze(self.network.predict_on_batch(nn_input)))
        output = self.network.predict_on_batch(nn_input)
        # if isinstance(output, float):
            # output = [output]
        return output

    def predict(self, data):
        parse_start = time.clock()
        nn_input = tf.convert_to_tensor(list(map(lambda x: self.parseString(parseLine(x, self.unit_dict,
                self.mins_per_worker_per_sec, self.gas_per_worker_per_sec, self.MAX_NUM_UNITS, 1), self.feature_shape), data.split("\n"))))
        parse_end = time.clock()
        prediction_start = time.clock()
        #output = np.ndarray.tolist(np.squeeze(self.network.predict_on_batch(nn_input)))
        output = self.network.predict_on_batch(nn_input)
        # print("output: " + str(output))
        prediction_end = time.clock()
        #if isinstance(output, float):
        #    output = [output]

        # print("{} time to parse, {} time to predict".format(parse_end - parse_start, prediction_end - prediction_start))
        return output

